<script>
    import anime from 'animejs';

    export default {
        name: "animation",
        data() {
            return {
                elements: [],
                text: {
                    partOne: {
                        visible: true,
                        animation: 'fadeIn fast'
                    },
                    partTwo: {
                        visible: false,
                        animation: 'fadeIn fast'
                    },
                    partThree: {
                        visible: false,
                        animation: 'fadeIn fast'
                    }
                },
                button: {
                    visible: false,
                    animation: 'fadeIn slow'
                },
                mess: {
                    visible: false
                },
                stage: 0
            }
        },
        mounted() {
            const one = 2500;
            const two = one + 250;
            const three = two + 750;
            const four = three + 250;
            const five = four + 2000;
            const six = five + 2000;

            window.setTimeout(() => {
                this.text.partOne.animation = 'fadeOut faster';
            }, one);
            window.setTimeout(() => {
                this.mess.visible = true;
                this.animate(750, 'easeInOutExpo', 1000);
            }, two);
            window.setTimeout(() => {
                this.animate(750, 'easeOutBack', 0);
            }, three);
            window.setTimeout(() => {
                this.text.partOne.visible = false;
                this.text.partTwo.visible = true;
                this.text.partTwo.animation = 'fadeIn faster';
            }, four);
            window.setTimeout(() => {
                this.text.partThree.visible = true;
            }, five);
            window.setTimeout(() => {
                this.button.visible = true;
            }, six);
        },
        methods: {
            animate(duration, easing, elasticity) {
                let elements = document.querySelectorAll('path');
                for (let i = 0; i < elements.length; i++) {
                    if (!!this.elements[i]) {
                        this.elements[i].duration = duration;
                        this.elements[i].easing = easing;
                        this.elements[i].reverse();
                        this.elements[i].play();
                        continue;
                    }

                    let el = elements[i];
                    let offset = anime.setDashoffset(el);
                    el.setAttribute('stroke-dashoffset', offset);

                    if (!this.elements[i]) {
                        this.elements[i] = anime({
                            targets: el,
                            strokeDashoffset: [offset, 0],
                            duration: duration,
                            loop: false,
                            direction: 'alternate',
                            // elasticity: elasticity,
                            easing: easing,
                            autoplay: true
                        });
                    }
                }
            },
        }
    }
</script>

